const fs = require('fs');
var result = {
    provinces: exports.PROVINCE.map(function (province) {
        var districts = exports.DISTRICT.filter(function (district) { 
            return district.ProvinceId.toLowerCase() === province.ID.toLowerCase(); 
        }).map(function (district) {
            var wards = exports.WARD.filter(function (ward) { 
                return ward.DistrictId.toLowerCase() === district.ID.toLowerCase(); 
            }).map(function (ward) { 
                return {
                    name: ward.Name
                }; 
            });
            return {
                name: district.Name,
                wards: wards
            };
        });
        return {
            name: province.Name,
            districts: districts
        };
    })
};
// Convert the result to a JSON string
const jsonString = JSON.stringify(result, null, 2);

// Write the JSON string to a file
fs.writeFile('app/db/geo_units2.json', jsonString, (err) => {
    if (err) {
        console.error('Error writing file', err);
    } else {
        console.log('Successfully wrote file');
    }
});

